  \"2013-03-15T14:32:25.756473\",\n\t\"name\": \"naip-1m-clr-2003\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The NAIP_1M_CLR_2003 dataset is a 1:40000
  scale (1 meter) truecolor (3 band) NAIP imagery product acquired during the summer
  of 2003. This data set contains imagery from the National Agricultural Imagery Program
  (NAIP) acquired in August 2003. NAIP acquires digital ortho imagery during the agricultural
  growing seasons in the continental U.S.. A primary goal of the NAIP program is to
  enable availabilty of ortho imagery within a year of acquisition. NAIP provides
  two main products: 1 meter ground sample distance (GSD) ortho imagery rectified
  to a horizontal accuracy of within +/- 3 meters of reference digital ortho quarter
  quads (DOQQS) from the National Digital Ortho Program (NDOP); and, 2 meter GSD ortho
  imagery rectified to within +/- 20 meters of reference DOQQs. The tiling format
  of NAIP imagery is based on a 3.75' x 3.75' quarter quadrangle with a 360 meter
  buffer on all four sides. NAIP quarter quads are rectified to the UTM coordinate
  system NAD83. NAIP imagery can obtain as much as 10% cloud cover per tile. The 2003
  NAIP imagery is available from VCGI's Image Library. VCGI reproject the imagery
  to Vermont State Plane Meters NAD83.\",\n\t\"license_title\": null,\n\t\"extras\":
